(3386, 753, 'post_title', 'รถกระบะรับจ้าง บริการรถรับจ้างราคาถูก รถรับจ้าง4ล้อ รถรับจ้าง6ล้อ กรุงเทพ-ต่างจังหวัด บริการ 24 ชั่วโมง'),
(3387, 753, 'adverts_price', '1000'),
(3388, 753, 'post_content', 'โอ๋ บริการ รับขนของทั่วไทย\r\nรับงานขนของ ย้ายห้อง ย้ายสำนักงาน และส่งสินค้าบริษัท ทั่วประเทศ\r\nรถกระบะตู้ทึบ กันแดดกันน้ำได้\r\n\r\n<img class="alignnone size-full wp-image-754" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012051112-1.jpg" alt="C012051112 (1)" width="274" height="187" />\r\n\r\nราคาในกรุงเทพฯ เที่ยวละ 800 บาท\r\nราคาปริมณฑล เที่ยวละ 1000 บาท\r\nต่างจังหวัดกิโลเมตรละ 12 บาท เช่น ระยอง 200 กม. ราคา 2600 บาท\r\nเหมาวันราคา 2200 บาท 9 ชั่วโมง\r\n\r\nคนขนของราคา 200-500\r\n\r\nโทรสอบถามได้ตลอด 24 ชม.\r\n095-892-2715\r\nขอบคุณครับ'),
