(570, 10, '2016-01-08 21:07:28', '2016-01-08 14:07:28', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS II ราคา 9,900 บาทชัตเตอร์25490 รับประกัน 1 เดือน ตัวกล้องสภาพสวย อุปกรณ์มีที่ชาร์ท กระเป๋า \r\nสนใจติดต่อ 099-999999\r\n*********************************************************\r\nขั้นตอนการสั่งซื้อสินค้า :\r\n1.ติดต่อ 09-999999\r\n2.โอนเงินเข้าบัญชี ของร้าน (โทรมาสอบถาม)\r\n3.แจ้งหลักฐานการโอนเงิน \r\n4.แจ้งชื่อและที่อยู่ที่ต้องการให้จัดส่งสินค้า\r\n5.ทางร้านจะจัดส่งสินค้าก่อน 16.00 น. ของทุกวันหลังจากได้รับยอดโอนเรียบร้อยแล้ว\r\n6.ทางร้านจะแจ้งหลักฐานการจัดส่งสินค้าให้ทราบหลังจากจัดส่งสินค้าเสร็จจ้า\r\nขอบคุณค่ะ\r\n\r\nสินค้าชิ้นนี้เป็นสินค้าที่โพสทดสอบ เท่านั้น', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS', '', 'publish', 'closed', 'closed', '', '%e0%b8%82%e0%b8%b2%e0%b8%a2%e0%b8%81%e0%b8%a5%e0%b9%89%e0%b8%ad%e0%b8%87-canon-1100d-%e0%b8%9e%e0%b8%a3%e0%b9%89%e0%b8%ad%e0%b8%a1%e0%b9%80%e0%b8%a5%e0%b8%99%e0%b8%aa%e0%b9%8c-18-55mm-is-ii', '', '', '2016-02-03 13:32:09', '2016-02-03 06:32:09', '', 0, 'http://dev.rodrubjang.com/?post_type=post&#038;p=570', 0, 'post', '', 0),
