(642, 10, '2016-01-08 23:09:14', '2016-01-08 16:09:14', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS II ราคา 9,900 บาทชัตเตอร์25490 รับประกัน 1 เดือน ตัวกล้องสภาพสวย อุปกรณ์มีที่ชาร์ท กระเป๋า\r\nสนใจติดต่อ 099-999999\r\n\r\n<img class="alignnone wp-image-800" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-1.jpg" alt="C012050383 (1)" width="414" height="307" />\r\n\r\n<img class="alignnone wp-image-801" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-2.jpg" alt="C012050383 (2)" width="428" height="213" />\r\n\r\n<img class="alignnone wp-image-802" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383.jpg" alt="C012050383" width="424" height="100" />\r\n\r\n*********************************************************\r\n\r\nขั้นตอนการสั่งซื้อสินค้า :\r\n1.ติดต่อ 09-999999\r\n2.โอนเงินเข้าบัญชี ของร้าน (โทรมาสอบถาม)\r\n3.แจ้งหลักฐานการโอนเงิน\r\n4.แจ้งชื่อและที่อยู่ที่ต้องการให้จัดส่งสินค้า\r\n5.ทางร้านจะจัดส่งสินค้าก่อน 16.00 น. ของทุกวันหลังจากได้รับยอดโอนเรียบร้อยแล้ว\r\n6.ทางร้านจะแจ้งหลักฐานการจัดส่งสินค้าให้ทราบหลังจากจัดส่งสินค้าเสร็จจ้า\r\nขอบคุณค่ะ\r\n\r\nสินค้าชิ้นนี้เป็นสินค้าที่ลงประกาศเพื่อทดสอบเท่านั้น ไม่ได้ประกาศขายจริง', 'รถกระบะรับจ้าง บริการรถรับจ้างราคาถูก รถรับจ้าง4ล้อ รถรับจ้าง6ล้อ กรุงเทพ-ต่างจังหวัด บริการ 24 ชั่วโมง', '', 'publish', 'closed', 'closed', '', '%e0%b8%82%e0%b8%b2%e0%b8%a2%e0%b8%81%e0%b8%a5%e0%b9%89%e0%b8%ad%e0%b8%87-canon-1100d-%e0%b8%9e%e0%b8%a3%e0%b9%89%e0%b8%ad%e0%b8%a1%e0%b9%80%e0%b8%a5%e0%b8%99%e0%b8%aa%e0%b9%8c-18-55mm-is-4', '', '', '2016-02-04 15:19:30', '2016-02-04 08:19:30', '', 0, 'http://dev.rodrubjang.com/?post_type=post&#038;p=642', 0, 'post', '', 0),
