(674, 1, '2016-01-09 00:15:06', '2016-01-08 17:15:06', '<img class="size-full wp-image-673 aligncenter" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/sheep-861072_640-1.jpg" alt="sheep-861072_640-1" width="640" height="424" />\r\n\r\nประเทศไทย หรือชื่อทางการว่า ราชอาณาจักรไทย เป็นรัฐชาติอันตั้งอยู่บนคาบสมุทรอินโดจีนและมลายู ในภูมิภาคเอเชียตะวันออกเฉียงใต้ มีพรมแดนด้านตะวันออกติดประเทศลาวและประเทศกัมพูชา ทิศใต้เป็นแดนต่อแดนประเทศมาเลเซียและอ่าวไทย ทิศตะวันตกติดทะเลอันดามันและประเทศพม่า และทิศเหนือติดประเทศพม่าและลาว มีแม่น้ำโขงกั้นเป็นบางช่วง มีศูนย์กลางการบริหารราชการแผ่นดินอยู่ที่กรุงเทพมหานคร และการปกครองส่วนภูมิภาค จัดระเบียบเป็น 76 จังหวัด แม้จะมีการสถาปนาระบอบราชาธิปไตยภายใต้รัฐธรรมนูญและประชาธิปไตยระบบรัฐสภาใน พ.ศ. 2475 แต่กองทัพยังมีบทบาทในการเมืองไทย ล่าสุด เกิดรัฐประหารเมื่อวันที่ 22 พฤษภาคม พ.ศ. 2557 และประเทศไทยปกครองแบบเผด็จการทหาร\r\n\r\nประเทศไทยมีขนาดใหญ่เป็นอันดับที่ 51 ของโลก มีเนื้อที่ 513,115 ตารางกิโลเมตร และมีประชากรมากเป็นอันดับที่ 20 ของโลก คือ ประมาณ 66 ล้านคน กับทั้งยังเป็นประเทศอุตสาหกรรมใหม โดยมีรายได้หลักจากภาคอุตสาหกรรมและการบริการ ไทยมีแหล่งท่องเที่ยวที่มีชื่อเสียงเป็นอันมาก อาทิ พัทยา, ภูเก็ต, กรุงเทพมหานคร และเชียงใหม่ ซึ่งสร้างรายได้ให้แก่ประเทศ เช่นเดียวกับการส่งออกอันมีส่วนสำคัญในการพัฒนาเศรษฐกิจและด้วยจีดีพีของประเทศ ซึ่งมีมูลค่าราว 334,026 ล้านดอลลาร์สหรัฐ ตามที่ประมาณใน พ.ศ. 2553 เศรษฐกิจของประเทศไทยนับว่าใหญ่เป็นอันดับที่ 32 ของโลก\r\n\r\nImage by Alexas_Fotos', 'ประเทศไทย ชื่อทางการว่าราชอาณาจักรไทย', '', 'inherit', 'closed', 'closed', '', '672-revision-v1', '', '', '2016-01-09 00:15:06', '2016-01-08 17:15:06', '', 672, 'http://dev.rodrubjang.com/674/', 0, 'revision', '', 0),
