(719, 1, '2016-01-09 23:25:56', '2016-01-09 16:25:56', '<p style="text-align: center;"><img class="alignnone size-full wp-image-707" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/contact-us.png" alt="contact-us" width="600" height="427" /></p>\r\n<p style="text-align: left;"><strong><span style="color: #003366;">ข้อมูลการติดต่อ</span></strong></p>\r\n<p style="text-align: left;">ที่อยู่: 999/99 อาคารเฟสบุ๊ก เขตบางเขน กรุงเทพ 12000</p>\r\n<p style="text-align: left;">อีเมล: admin@google.com</p>\r\n<p style="text-align: left;">โทร: 099999999</p>\r\n<p style="text-align: left;">ไลน์: uweb</p>\r\n<p style="text-align: left;">เว็บไซต์: <a href="https://www.thaitheme.com">www.ThaiTheme.com</a></p>\r\n&nbsp;\r\n<p style="text-align: left;"><span style="color: #003366;"><strong>แผนที่บริษัท</strong></span></p>\r\n<p style="text-align: center;"><iframe style="border: 0;" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d496113.9184038547!2d100.3529059973615!3d13.72510974500008!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x311d6032280d61f3%3A0x10100b25de24820!2z4LiB4Lij4Li44LiH4LmA4LiX4Lie4Lih4Lir4Liy4LiZ4LiE4Lij!5e0!3m2!1sth!2sth!4v1452355455411" width="800" height="600" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', 'ติดต่อเรา', '', 'inherit', 'closed', 'closed', '', '705-revision-v1', '', '', '2016-01-09 23:25:56', '2016-01-09 16:25:56', '', 705, 'http://dev.rodrubjang.com/719/', 0, 'revision', '', 0),
(721, 1, '2016-01-09 23:47:32', '2016-01-09 16:47:32', '<p style="text-align: center;"><img class="alignnone size-full wp-image-724" src="http://dev.rodrubjang.com/wp-content/uploads/2015/10/law-post.png" alt="law-post" width="600" height="535" /></p>\n1. การสมัครสมาชิก การใช้บริการ การเยี่ยมชม เว็บไซต์ เป็นการแสดงเจตนายอมรับที่จะปฏิบัติตามข้อกำหนดและเงื่อนไขการใช้บริการ รวมทั้งกฎ และข้อจำกัดการใช้บริการของ เว็บไซต์ ทุกประการอย่างต่อเนื่อง\n\n2. ท่านตกลงว่า ท่านจะไม่กระทำการใดอันขัดต่อกฎหมาย และ/หรือ ศีลธรรมอันดีของประชาชน ไม่ล่วงละเมิดสิทธิใดๆ ของ เว็บไซต์ หรือบุคคลอื่น และไม่กระทำการใดอันก่อให้เกิดความเสียหายต่อ เว็บไซต์ หรือบุคคลอื่น\n\n3. เว็บไซต์ สงวนสิทธิที่จะแก้ไข เพิ่มเติม ปรับปรุง เปลี่ยนแปลง ระงับ ยับยั้ง ปิดกั้น และลบ เนื้อหาข้อมูล (Content) ใดๆ ใน เว็บไซต์ โดยไม่ต้องบอกกล่าว โดยถือเป็นสิทธิขาดและขึ้นอยู่กับดุลพินิจของ เว็บไซต์ แต่เพียงผู้เดียว\n\n4. เว็บไซต์ สงวนสิทธิในการโอนบริการและบริการพิเศษของ เว็บไซต์ รวมทั้งสิทธิและหน้าที่ของ เว็บไซต์ ไม่ว่าทั้งหมดหรือบางส่วน ให้แก่บริษัทในเครือหรือบุคคลภายนอก โดยไม่ต้องบอกกล่าวล่วงหน้า และไม่ต้องได้รับอนุญาตจาก “ผู้ใช้บริการ”\n\n5. สิทธิของ “ผู้ใช้บริการ” ขึ้นอยู่กับกฎหมายและนโยบายการใช้งานของ เว็บไซต์ นี้ การยุติข้อโต้แย้งและข้อพิพาทต่างๆ ขึ้นอยู่กับดุลพินิจและการตัดสินใจของ เว็บไซต์ แต่เพียงผู้เดียว\n\n6. เว็บไซต์ สงวนสิทธิที่จะแก้ไข เพิ่มเติม ปรับปรุง และเปลี่ยนแปลง ข้อกำหนดและเงื่อนไขการใช้บริการนี้ รวมทั้งกฎและข้อจำกัดการใช้บริการ เว็บไซต์ ได้ ตามที่ เว็บไซต์ เห็นสมควรได้โดยไม่ต้องบอกกล่าว และเป็นหน้าที่ของท่านที่ต้องตรวจสอบข้อกำหนด เงื่อนไข กฎ และข้อจำกัดต่างๆ ด้วยตนเอง', 'กฎกติกาการลงประกาศ', '', 'inherit', 'closed', 'closed', '', '5-autosave-v1', '', '', '2016-01-09 23:47:32', '2016-01-09 16:47:32', '', 5, 'http://dev.rodrubjang.com/721/', 0, 'revision', '', 0),
