(731, 10, '2016-02-02 21:32:45', '2016-02-02 14:32:45', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS II ราคา 9,900 บาทชัตเตอร์25490 รับประกัน 1 เดือน ตัวกล้องสภาพสวย อุปกรณ์มีที่ชาร์ท กระเป๋า\r\nสนใจติดต่อ 099-999999\r\n\r\n*********************************************************\r\n\r\nขั้นตอนการสั่งซื้อสินค้า :\r\n1.ติดต่อ 09-999999\r\n2.โอนเงินเข้าบัญชี ของร้าน (โทรมาสอบถาม)\r\n3.แจ้งหลักฐานการโอนเงิน\r\n4.แจ้งชื่อและที่อยู่ที่ต้องการให้จัดส่งสินค้า\r\n5.ทางร้านจะจัดส่งสินค้าก่อน 16.00 น. ของทุกวันหลังจากได้รับยอดโอนเรียบร้อยแล้ว\r\n6.ทางร้านจะแจ้งหลักฐานการจัดส่งสินค้าให้ทราบหลังจากจัดส่งสินค้าเสร็จจ้า\r\nขอบคุณค่ะ\r\n\r\nสินค้าชิ้นนี้เป็นสินค้าที่ลงประกาศเพื่อทดสอบเท่านั้น ไม่ได้ประกาศขายจริง', 'หูฟังไร้สาย MEE audio hd Wave Bluetooth Wireless', '', 'inherit', 'closed', 'closed', '', '662-revision-v1', '', '', '2016-02-02 21:32:45', '2016-02-02 14:32:45', '', 662, 'http://dev.rodrubjang.com/731/', 0, 'revision', '', 0),
