(753, 1, '2016-02-03 09:19:31', '2016-02-03 02:19:31', 'โอ๋ บริการ รับขนของทั่วไทย\r\nรับงานขนของ ย้ายห้อง ย้ายสำนักงาน และส่งสินค้าบริษัท ทั่วประเทศ\r\nรถกระบะตู้ทึบ กันแดดกันน้ำได้\r\n\r\n<img class="alignnone size-full wp-image-754" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012051112-1.jpg" alt="C012051112 (1)" width="274" height="187" />\r\n\r\nราคาในกรุงเทพฯ เที่ยวละ 800 บาท\r\nราคาปริมณฑล เที่ยวละ 1000 บาท\r\nต่างจังหวัดกิโลเมตรละ 12 บาท เช่น ระยอง 200 กม. ราคา 2600 บาท\r\nเหมาวันราคา 2200 บาท 9 ชั่วโมง\r\n\r\nคนขนของราคา 200-500\r\n\r\nโทรสอบถามได้ตลอด 24 ชม.\r\n095-892-2715\r\nขอบคุณครับ', 'รถกระบะรับจ้าง บริการรถรับจ้างราคาถูก รถรับจ้าง4ล้อ รถรับจ้าง6ล้อ กรุงเทพ-ต่างจังหวัด บริการ 24 ชั่วโมง', '', 'publish', 'open', 'closed', '', '%e0%b8%a3%e0%b8%96%e0%b8%81%e0%b8%a3%e0%b8%b0%e0%b8%9a%e0%b8%b0%e0%b8%a3%e0%b8%b1%e0%b8%9a%e0%b8%88%e0%b9%89%e0%b8%b2%e0%b8%87-%e0%b8%9a%e0%b8%a3%e0%b8%b4%e0%b8%81%e0%b8%b2%e0%b8%a3%e0%b8%a3%e0%b8%96', '', '', '2016-02-03 13:36:36', '2016-02-03 06:36:36', '', 0, 'http://dev.rodrubjang.com/?p=753', 0, 'post', '', 0),
