(803, 1, '2016-02-04 13:15:42', '2016-02-04 06:15:42', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS II ราคา 9,900 บาทชัตเตอร์25490 รับประกัน 1 เดือน ตัวกล้องสภาพสวย อุปกรณ์มีที่ชาร์ท กระเป๋า\nสนใจติดต่อ 099-999999\n\n<img class="alignnone  wp-image-800" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-1.jpg" alt="C012050383 (1)" width="414" height="307" /> <img class="alignnone size-medium wp-image-801" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-2.jpg" alt="C012050383 (2)" width="750" height="560" /> <img class="alignnone size-medium wp-image-802" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383.jpg" alt="C012050383" width="960" height="355" />\n\n*********************************************************\n\nขั้นตอนการสั่งซื้อสินค้า :\n1.ติดต่อ 09-999999\n2.โอนเงินเข้าบัญชี ของร้าน (โทรมาสอบถาม)\n3.แจ้งหลักฐานการโอนเงิน\n4.แจ้งชื่อและที่อยู่ที่ต้องการให้จัดส่งสินค้า\n5.ทางร้านจะจัดส่งสินค้าก่อน 16.00 น. ของทุกวันหลังจากได้รับยอดโอนเรียบร้อยแล้ว\n6.ทางร้านจะแจ้งหลักฐานการจัดส่งสินค้าให้ทราบหลังจากจัดส่งสินค้าเสร็จจ้า\nขอบคุณค่ะ\n\nสินค้าชิ้นนี้เป็นสินค้าที่ลงประกาศเพื่อทดสอบเท่านั้น ไม่ได้ประกาศขายจริง', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS', '', 'inherit', 'closed', 'closed', '', '642-autosave-v1', '', '', '2016-02-04 13:15:42', '2016-02-04 06:15:42', '', 642, 'http://dev.rodrubjang.com/803/', 0, 'revision', '', 0),
(804, 1, '2016-02-04 13:16:29', '2016-02-04 06:16:29', 'ขายกล้อง Canon 1100D พร้อมเลนส์ 18-55mm IS II ราคา 9,900 บาทชัตเตอร์25490 รับประกัน 1 เดือน ตัวกล้องสภาพสวย อุปกรณ์มีที่ชาร์ท กระเป๋า\r\nสนใจติดต่อ 099-999999\r\n\r\n<img class="alignnone  wp-image-800" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-1.jpg" alt="C012050383 (1)" width="414" height="307" />\r\n\r\n<img class="alignnone  wp-image-801" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-2.jpg" alt="C012050383 (2)" width="428" height="213" />\r\n\r\n<img class="alignnone  wp-image-802" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383.jpg" alt="C012050383" width="424" height="100" />\r\n\r\n*********************************************************\r\n\r\nขั้นตอนการสั่งซื้อสินค้า :\r\n1.ติดต่อ 09-999999\r\n2.โอนเงินเข้าบัญชี ของร้าน (โทรมาสอบถาม)\r\n3.แจ้งหลักฐานการโอนเงิน\r\n4.แจ้งชื่อและที่อยู่ที่ต้องการให้จัดส่งสินค้า\r\n5.ทางร้านจะจัดส่งสินค้าก่อน 16.00 น. ของทุกวันหลังจากได้รับยอดโอนเรียบร้อยแล้ว\r\n6.ทางร้านจะแจ้งหลักฐานการจัดส่งสินค้าให้ทราบหลังจากจัดส่งสินค้าเสร็จจ้า\r\nขอบคุณค่ะ\r\n\r\nสินค้าชิ้นนี้เป็นสินค้าที่ลงประกาศเพื่อทดสอบเท่านั้น ไม่ได้ประกาศขายจริง', 'รถกระบะรับจ้าง บริการรถรับจ้างราคาถูก รถรับจ้าง4ล้อ รถรับจ้าง6ล้อ กรุงเทพ-ต่างจังหวัด บริการ 24 ชั่วโมง', '', 'inherit', 'closed', 'closed', '', '642-revision-v1', '', '', '2016-02-04 13:16:29', '2016-02-04 06:16:29', '', 642, 'http://dev.rodrubjang.com/804/', 0, 'revision', '', 0),
(805, 1, '2016-02-04 15:17:36', '2016-02-04 08:17:36', '<img class=" wp-image-673 aligncenter" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/sheep-861072_640-1.jpg" alt="sheep-861072_640-1" width="500" height="331" />\r\n\r\nประเทศไทย หรือชื่อทางการว่า ราชอาณาจักรไทย เป็นรัฐชาติอันตั้งอยู่บนคาบสมุทรอินโดจีนและมลายู ในภูมิภาคเอเชียตะวันออกเฉียงใต้ มีพรมแดนด้านตะวันออกติดประเทศลาวและประเทศกัมพูชา ทิศใต้เป็นแดนต่อแดนประเทศมาเลเซียและอ่าวไทย ทิศตะวันตกติดทะเลอันดามันและประเทศพม่า และทิศเหนือติดประเทศพม่าและลาว มีแม่น้ำโขงกั้นเป็นบางช่วง มีศูนย์กลางการบริหารราชการแผ่นดินอยู่ที่กรุงเทพมหานคร และการปกครองส่วนภูมิภาค จัดระเบียบเป็น 76 จังหวัด แม้จะมีการสถาปนาระบอบราชาธิปไตยภายใต้รัฐธรรมนูญและประชาธิปไตยระบบรัฐสภาใน พ.ศ. 2475\r\n\r\n\r\nประเทศไทยมีขนาดใหญ่เป็นอันดับที่ 51 ของโลก มีเนื้อที่ 513,115 ตารางกิโลเมตร และมีประชา<img class="alignnone  wp-image-800" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-1.jpg" alt="C012050383 (1)" width="475" height="355" /> <img class="alignnone  wp-image-802" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383.jpg" alt="C012050383" width="471" height="174" /> <img class="alignnone  wp-image-801" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012050383-2.jpg" alt="C012050383 (2)" width="497" height="371" />\r\n\r\n<img class="alignnone size-medium wp-image-799" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ads_kaewngam_service.gif" alt="ads_kaewngam_service" width="274" height="187" />\r\n\r\n<img class="alignnone size-medium wp-image-754" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012051112-1.jpg" alt="C012051112 (1)" width="274" height="187" />\r\n\r\n<img class="alignnone  wp-image-752" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/spd_20110904190656_b.jpg" alt="spd_20110904190656_b" width="407" height="327" />ก\r\n\r\nรมากเป็นอันดับที่ 20 ของโลก คือ ประมาณ 66 ล้านคน กับทั้งยังเป็นประเทศอุตสาหกรรมใหม โดยมีรายได้หลักจากภาคอุตสาหกรรมและการบริการ ไทยมีแหล่งท่องเที่ยวที่มีชื่อเสียงเป็นอันมาก อาทิ พัทยา, ภูเก็ต, กรุงเทพมหานคร และเชียงใหม่ ซึ่งสร้างรายได้ให้แก่ประเทศ เช่นเดียวกับการส่งออกอันมีส่วนสำคัญในการพัฒนาเศรษฐกิจและด้วยจีดีพีของประเทศ ซึ่งมีมูลค่าราว 334,026 ล้านดอลลาร์สหรัฐ ตามที่ประมาณใน พ.ศ. 2553 เศรษฐกิจของประเทศไทยนับว่าใหญ่เป็นอันดับที่ 32 ของโลก\r\n\r\nImage by Alexas_Fotos', 'ประเทศไทย มีชื่อทางการว่าราชอาณาจักรไทย', '', 'inherit', 'closed', 'closed', '', '687-revision-v1', '', '', '2016-02-04 15:17:36', '2016-02-04 08:17:36', '', 687, 'http://dev.rodrubjang.com/805/', 0, 'revision', '', 0),
